import React from 'react';
import Button from "@material-ui/core/Button";


interface Props {
    startIcon?: any;
    variant?: any;
    color?: any;
    children?: any;
    disabled?: boolean;
  }

  const Buttons2: React.FunctionComponent<Props> = (props) => {
    return (
      <div>
        <Button
          startIcon={props.startIcon}
          variant={props.variant}
          color={props.color}
          disabled={props.disabled}
        >
          {props.children}
        </Button>
      </div>
    );
  };

export default Buttons2
